73,5 proc. respondentów uważa, że wyjaśnienia kandydata PiS są nieprzekonujące. 21,9 proc. badanych uznała je za wiarygodne. 4,6 proc. Polaków udzieliło odpowiedzi "nie wiem/trudno powiedzieć".

Ankieterzy w kontekście pytania zwracają uwagę, że "najbardziej krytyczni są zwolennicy Konfederacji. 97 proc. osób deklarujących poparcie dla partii Sławomira Mentzena twierdzi, że nie wierzy w wyjaśnienia Nawrockiego, dlatego nie pójdą na niego głosować"

